import React from 'react';
import Navbar from './NavbarHome';
import '../App.css';

const Home = ({ user }) => {
    return (
        <div className="home">
            <Navbar/>
            <div style={{height: "50vw", position: "relative"}}>
                <div style={{position: "absolute", top: "50%", left: "50%", transform: "translate(-50%, -50%)", transform: "translate(-50%, -50%)"}}>
                    <h1 style={{textAlign: "center"}}>Welcome to our survey on human image recognition</h1>
                </div> 
            </div>          
        </div>
    )
}

export default Home;
